import React from "react";
import Form from "../../../common/form";

class ManualUploadForm extends Form {
  state = {};

  render() {
    return (
      <div className="form-container">
        <div className="form-wrapper">{this.renderInput("name")}</div>
      </div>
    );
  }
}

export default ManualUploadForm;
